import React from 'react';

class Order extends React.Component {
  render() {
    const orderIds = Object.keys(this.state.order);

    return (
      <div className="order-wrap">
        <h2>Order</h2>
        <ul>
          <li></li>
        </ul>
        <h2>Total: {orderIds}</h2>
      </div>
    )
  }
}

export default Order;
